import React, { useState } from "react";
import "./FindMembers.scss";

const FindPlayer = (props) => {
  const [value, setValue] = useState("");

  const handleOnChange = (event) => {
    event.preventDefault();
    const value = event.curentTarget.value;
    setValue(value);
  };

  return (
    <div className="find-players">
      <p className="members-title">Members</p>
      <div className="search-area">
        <input placeholder="Search Members..." value={value} />
        <i className="fas fa-search"></i>
        <ul className="members-list"></ul>
      </div>
    </div>
  );
};

export default FindPlayer;
